import React, { useRef } from 'react'

export default function App() {
  const name = useRef()
  const password = useRef()
  const submitHandler=(event)=>{
    event.preventDefault()
    console.log(name.current.value,name.current.placeholder,this.password.current.value)
  }
  return (
    <div>
      <h1>Uncontrolled Components</h1>
        <form onSubmit={submitHandler}>
          <input type="text" placeholder='enter your name' ref={name}/> <br /><br />
          <input type="password" placeholder='enter your password' ref={password} /><br /><br />
          <button type='submit'>Submit</button>
        </form>
    </div>
  )
}
